import React from 'react';

function FilterYear(props) {
    return (
        <div 
            style={{
                dispa
            }}
        >
            <b>Filter by year</b>
            <select>
                <option value="">
                    {props.year}
                </option>
            </select>
        </div>
    );
}

export default FilterYear;
